<p-toast></p-toast>
<div class="px-5 flex justify-content-center align-items-center" >
    <div
        class="mt-8 border-1 surface-border surface-card border-round py-7 px-4 md:px-7 z-1" 
        style="margin-top: 10% !important;"
    >
        <div class="mb-4">
            <div class="text-900 text-xl font-bold mb-2">Log in</div>
            <span class="text-600 font-medium">Please enter your details</span>
        </div>
        <div class="flex flex-column">
            <span class="p-input-icon-left w-full mb-4">
                <i class="pi pi-user"></i>
                <input
                    id="userId"
                    type="text"
                    pInputText
                    class="w-full md:w-25rem"
                    placeholder="User ID"
                    autocomplete="off"
                    [(ngModel)] = "loginDetails.userName"
                    upperCase
                />
            </span>
            <span class="p-input-icon-left w-full mb-4">
                <i class="pi pi-lock"></i>
                <input
                    id="password"
                    type="password"
                    autocomplete="off"
                    pInputText
                    class="w-full md:w-25rem"
                    placeholder="Password"
                    [(ngModel)] = "loginDetails.userPassword"
                    (keypress)="($event.which === 13)?login(loginDetails):0"
                />
            </span>
            <div class="mb-4 flex flex-wrap gap-3">
                <!-- <div>
                    <p-checkbox
                        name="checkbox"
                        value="val"
                        styleClass="mr-2"
                        [(ngModel)]="loginDetails.rememberMe"
                    ></p-checkbox>
                    <label for="checkbox" class="text-900 font-medium mr-8"
                        >Remember Me</label
                    >
                </div> -->
                <div>
                    <!-- <a
                    class="text-600 cursor-pointer hover:text-primary cursor-pointer ml-auto transition-colors transition-duration-300"
                    [routerLink]="['/register']"
                    >Register</a
                > -->
            </div>
                <!-- <a
                    class="text-600 cursor-pointer hover:text-primary cursor-pointer ml-auto transition-colors transition-duration-300"
                    >Reset password</a
                > -->
            </div>
            <button
                pButton
                pRipple
                label="Log In"
                class="w-full"
                [routerLink]="['/']"
                (click)="login(loginDetails)"
            ></button>
            <!-- <div class="mb-4 mt-2 flex flex-wrap gap-3">
                <a
                    class="text-600 cursor-pointer hover:text-primary cursor-pointer ml-auto transition-colors transition-duration-300"
                    [routerLink]="['/register']"
                    >Register</a
                >
            </div> -->
        </div>
    </div>
</div>
